import React, { useState } from 'react';
import { Card, CardHeader, CardTitle, CardContent } from './components/shadcn-components';
import { User, Mail, Lock, Eye, EyeOff, Bell, Moon, Edit, Save } from 'lucide-react';

// Composant de connexion
export const LoginPage = () => {
  const [showPassword, setShowPassword] = useState(false);
  const [credentials, setCredentials] = useState({
    email: '',
    password: ''
  });

  const handleLogin = (e) => {
    e.preventDefault();
    // Implémenter la logique de connexion ici
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-900 px-4">
      <Card className="w-full max-w-md">
        <CardHeader>
          <CardTitle className="text-2xl text-center">Connexion</CardTitle>
        </CardHeader>
        <CardContent>
          <form onSubmit={handleLogin} className="space-y-4">
            <div className="space-y-2">
              <label className="text-sm font-medium">Email</label>
              <div className="relative">
                <input
                  type="email"
                  className="w-full pl-10 pr-4 py-2 bg-gray-800 border border-gray-700 rounded-lg"
                  value={credentials.email}
                  onChange={(e) => setCredentials({...credentials, email: e.target.value})}
                />
                <Mail className="absolute left-3 top-2.5 h-5 w-5 text-gray-400" />
              </div>
            </div>

            <div className="space-y-2">
              <label className="text-sm font-medium">Mot de passe</label>
              <div className="relative">
                <input
                  type={showPassword ? "text" : "password"}
                  className="w-full pl-10 pr-12 py-2 bg-gray-800 border border-gray-700 rounded-lg"
                  value={credentials.password}
                  onChange={(e) => setCredentials({...credentials, password: e.target.value})}
                />
                <Lock className="absolute left-3 top-2.5 h-5 w-5 text-gray-400" />
                <button
                  type="button"
                  onClick={() => setShowPassword(!showPassword)}
                  className="absolute right-3 top-2.5"
                >
                  {showPassword ? 
                    <EyeOff className="h-5 w-5 text-gray-400" /> : 
                    <Eye className="h-5 w-5 text-gray-400" />
                  }
                </button>
              </div>
            </div>

            <button
              type="submit"
              className="w-full py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700"
            >
              Se connecter
            </button>
          </form>
        </CardContent>
      </Card>
    </div>
  );
};

// Composant de profil
export const ProfilePage = () => {
  const [profile, setProfile] = useState({
    name: "Admin User",
    email: "admin@example.com",
    role: "Administrateur",
    lastLogin: "2024-01-15 10:30",
    preferences: {
      notifications: true,
      darkMode: true
    }
  });

  const [isEditing, setIsEditing] = useState(false);
  const [editedProfile, setEditedProfile] = useState(profile);

  const handleSave = () => {
    setProfile(editedProfile);
    setIsEditing(false);
  };

  const togglePreference = (key) => {
    setEditedProfile({
      ...editedProfile,
      preferences: {
        ...editedProfile.preferences,
        [key]: !editedProfile.preferences[key]
      }
    });
  };

  return (
    <div className="min-h-screen bg-gray-900 py-12 px-4">
      <div className="max-w-4xl mx-auto">
        <Card>
          <CardHeader>
            <div className="flex justify-between items-center">
              <CardTitle className="text-2xl">Profil Administrateur</CardTitle>
              <button
                onClick={() => isEditing ? handleSave() : setIsEditing(true)}
                className="flex items-center px-4 py-2 bg-blue-600 rounded-lg hover:bg-blue-700"
              >
                {isEditing ? (
                  <><Save className="h-5 w-5 mr-2" /> Sauvegarder</>
                ) : (
                  <><Edit className="h-5 w-5 mr-2" /> Modifier</>
                )}
              </button>
            </div>
          </CardHeader>
          <CardContent>
            <div className="space-y-6">
              <div className="space-y-4">
                <h3 className="text-lg font-semibold">Informations personnelles</h3>
                <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                  <div className="space-y-2">
                    <label className="text-sm font-medium">Nom</label>
                    <input
                      type="text"
                      value={isEditing ? editedProfile.name : profile.name}
                      onChange={(e) => setEditedProfile({...editedProfile, name: e.target.value})}
                      disabled={!isEditing}
                      className="w-full px-4 py-2 bg-gray-800 border border-gray-700 rounded-lg"
                    />
                  </div>
                  <div className="space-y-2">
                    <label className="text-sm font-medium">Email</label>
                    <input
                      type="email"
                      value={isEditing ? editedProfile.email : profile.email}
                      onChange={(e) => setEditedProfile({...editedProfile, email: e.target.value})}
                      disabled={!isEditing}
                      className="w-full px-4 py-2 bg-gray-800 border border-gray-700 rounded-lg"
                    />
                  </div>
                </div>
              </div>

              <div className="space-y-4">
                <h3 className="text-lg font-semibold">Préférences</h3>
                <div className="space-y-4">
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-2">
                      <Bell className="h-5 w-5" />
                      <span>Notifications</span>
                    </div>
                    <button
                      onClick={() => isEditing && togglePreference('notifications')}
                      disabled={!isEditing}
                      className={`relative inline-flex h-6 w-11 items-center rounded-full ${
                        (isEditing ? editedProfile : profile).preferences.notifications
                          ? 'bg-blue-600'
                          : 'bg-gray-700'
                      }`}
                    >
                      <span className={`inline-block h-4 w-4 transform rounded-full bg-white transition ${
                        (isEditing ? editedProfile : profile).preferences.notifications
                          ? 'translate-x-6'
                          : 'translate-x-1'
                      }`} />
                    </button>
                  </div>

                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-2">
                      <Moon className="h-5 w-5" />
                      <span>Mode sombre</span>
                    </div>
                    <button
                      onClick={() => isEditing && togglePreference('darkMode')}
                      disabled={!isEditing}
                      className={`relative inline-flex h-6 w-11 items-center rounded-full ${
                        (isEditing ? editedProfile : profile).preferences.darkMode
                          ? 'bg-blue-600'
                          : 'bg-gray-700'
                      }`}
                    >
                      <span className={`inline-block h-4 w-4 transform rounded-full bg-white transition ${
                        (isEditing ? editedProfile : profile).preferences.darkMode
                          ? 'translate-x-6'
                          : 'translate-x-1'
                      }`} />
                    </button>
                  </div>
                </div>
              </div>

              <div className="space-y-4">
                <h3 className="text-lg font-semibold">Informations de connexion</h3>
                <div className="bg-gray-800 p-4 rounded-lg">
                  <p className="text-sm text-gray-400">
                    Dernière connexion : {profile.lastLogin}
                  </p>
                  <p className="text-sm text-gray-400">
                    Rôle : {profile.role}
                  </p>
                </div>
              </div>
            </div>
          </CardContent>
        </Card>
      </div>
    </div>
  );
};

export default { LoginPage, ProfilePage };
